(14,'Sakura Motors Welcome! - Mr. Mshana..','<div dir=\"auto\" style=\"font-family: \'Segoe UI Historic\', \'Segoe UI\', Helvetica, Arial, sans-serif; color: #050505; font-size: 15px; white-space: pre-wrap; background-color: #ffffff;\">One of our great customers Mr. Mshana visited the Sakura motors company in Japan. It&rsquo;s a pleasure to meet you personally. Thank you Mr Mshana for the visit and your continuous business with us.</div>\r\n<div dir=\"auto\" style=\"font-family: \'Segoe UI Historic\', \'Segoe UI\', Helvetica, Arial, sans-serif; color: #050505; font-size: 15px; white-space: pre-wrap; background-color: #ffffff;\">We wish you all the very best, continue to strengthen this relationship to serve you further.</div>','2023-02-11','Admin','2023-02-13 19:12:52','2023-02-13 19:12:52'),
(16,'New Business Engagements!!','<p class=\"MsoNormal\">Mr Chaminda Perera, the Managing Director of Cey Coir Substrates (Pvt) Ltd, paid a courtesy visit to Sakura Motors Japan. In his visit, he noted he will be partnering with us for new business opportunities. Our strength lies in our people who are very professional and together with our local and international partners, we are poised to deliver exceptional services. Thank you, Mr Chaminda, for the visit.</p>','2023-02-11','Admin','2023-02-22 00:59:45','2023-02-22 00:59:45'),
(17,'Warm Welcome Mr Kondo','<p class=\"MsoNormal\">Mr Tadayuki Kondo visited the Sakura Motors Japan, He is one of the pioneers, assisted to establish the Sakura Motors Company in 2010. <span style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; color: #4d5156; background: white;\">It has been an&nbsp;</span><span style=\"color: #4d5156;\">honour</span><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; color: #4d5156; background: white;\">&nbsp;and a privilege </span>to worked&nbsp;alongside<span style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Arial\',sans-serif; color: #4d5156; background: white;\"> a person such as </span>Mr Tadayuki and hope to continue and grow this work relationship for many more years.</p>','2023-04-06','Admin','2023-04-06 12:44:47','2023-04-06 12:44:47');
